async () => {
  const dates = [];
  for (let i = 1; i <= 10; i++) {
    const dateStr = `2026-01-${i.toString().padStart(2, '0')}`;
    dates.push(dateStr);
  }

  const results = [];

  for (const date of dates) {
    try {
      const response = await fetch('https://spot.poweremarket.com/uptspot/ma/spot/spottrade/scptp/sr/mp/spottrade/baseinfo/TranOver/getWatchUserPriceData', {
        method: 'POST',
        headers: {
          'accept': 'application/json, text/plain, */*',
          'content-type': 'application/json;charset=UTF-8',
        },
        body: JSON.stringify({
          operateDate: date,
          dateType: '1'  // å®æ—¶æ•°æ®
        })
      });

      const data = await response.json();
      results.push({
        date: date,
        success: data.code === 0,
        data: data
      });
    } catch (error) {
      results.push({
        date: date,
        success: false,
        error: error.message
      });
    }
  }

  return results;
}
